const Project = () => {

    let Navigate = useNavigate()



    const propsData = (localStorage.getItem('headers'));
    debugger

    const getProjectData = async() =>{
        console.warn('PropesData = ',propsData)
        let headers = {headers:{
            uid: propsData.uid,
            client: propsData.client,
            access_token: propsData.access_token,
        }}

        const resp = await axios.get('http://localhost:4000/projects',headers)
        console.warn(resp)
    }


    useEffect(()=>{
        Check()
    },[])

    const Check = () => {
        if (propsData == null){
            Navigate('/Login')
        }
        else {
            getProjectData()
        }
    }

    return (
        <>

        </>
    )
}


export default Project;
